function entcheck(x,y,k)
  --floor to 8 before passing in 

	 local t,t2,t3
		local floor = math.floor
	 local repl={104,8,14,104,167,107,30}
 
		t =mget(x,k+y-8+(level-1)*34)
	 t2=mget(x+1,k+y-8+(level-1)*34)
		t3=mget(x,k+y-9+(level-1)*34)
		
		--hitbox check 
		if t == 96 then
		 hitstore[x*(k+y-8)]=t3+176
			space = mget(x,k+y-7+(level-1)*34)
		
			mset(x,k+y-9+(level-1)*34,space)
		
		end
		
		
	 if t>=192 then		
		 if t ~= 211 
			and t ~= 227 then
			 if t2 < 192 
				and solids[t2] == nil then
				 mset(x,k+y-8+(level-1)*34,t2)
				elseif t2 >=192 then
				 if solids[t3] == true 
					or t3>=192 then
					 mset(x,k+y-8+(level-1)*34,repl[world])
					else
				  mset(x,k+y-8+(level-1)*34,t3)
					end
				else
		   mset(x,k+y-8+(level-1)*34,repl[world])
				end
			end
	 	entmake(floor(x*8)+1,floor(k*8+y*8-64),0,0,t,0,0,false,0,0,false)
			
		elseif t == 64  or t == 80 then
		 if gamestate == "play" then
			 local dist = 0
				if t==64 then 
				 dist = -3
			 elseif t == 80 then 
				 dist = 3 
				end
			 --mset(x,k+y-8+(level-1)*34,0)
			 plantmake(x*8+1,k*8+y*8-63,    --x1,y1
	            x*8+1,k*8+y*8-63+dist,  --x2,y2
	            0,  0,    --vx2,vy2
	            x*8+1,k*8+y*8-63+dist*2,  --x3,y3
	            0,  0,    --vx3,vy3
	            1,        --rigidity
	            t, 3)    --sprite,distance
   end
  end
end

function lines()
 local pi = math.pi
  for i=0,256,64 do
   linemult(math.sin(t+i)*30-math.cos(t/5)*50,
   135,
   -math.sin(t+i)*30+math.cos(t/5)*50,
   0,8,120)
   t=t+0.01
  end
end

function linemult(x,y,x2,y2,c,d)
 for i=0,240,240 do
  line(x+i+d,y,x2+i+d,y2,c)
 end
end


