function wline(x1,y1,x2,y2,c,w)
 for i=0,w,1 do
  line(x1+i,y1,x2+i,y2,c)
 end
end

function rotspr(s,x,y,r,w,h,fx,fy,sw,sh)
    if not w then
        w=1
    end
    if not h then
        h=1
    end
    if not sw then
        sw=8
    end
    if not sh then
        sh=8
    end
    local p={}
    local v=math.sqrt(32)
    for i=0,4 do
        p[i*2+1]=x+4+math.cos((0.375+i/4+(r/math.pi/2))*math.pi*2)*v*w
        p[i*2+2]=y+4+math.sin((0.375+i/4+(r/math.pi/2))*math.pi*2)*v*h
    end
    local x1=s%16*8
    local y1=math.floor(s/16)*8
    local x2=x1+sw
    local y2=y1+sh
    if fx then
        x1=x1+sw
        x2=x2-sw
    end
    if fy then
        y1=y1+sh
        y2=y2-sh
    end
    
    ttri(p[1],p[2],p[3],p[4],p[5],p[6],x1,y2,x1,y1,x2,y1,0)
    ttri(p[1],p[2],p[7],p[8],p[5],p[6],x1,y2,x2,y2,x2,y1,0)
end

function tablereset(tab)
	for i,v in ipairs(tab) do
	table.remove(tab,i)
	end
end

function savegame()
 trace("Saving")
 pmem(0,basiccoins)
 
 for i=1,#records do
  local spc=0
  if spcoins[i] == true then 
   spc = 999999 
  end
  --spc is special coins
  --we reserve memory by adding 9999 seconds
  
  pmem(i,math.ceil(records[i]*1000)+spc)
  
 end

 for h in ipairs(hats) do
  if hats[h].owned == true then
   pmem(128+h,1)
  end
 end
 
 pmem(254,deaths)

 pmem(255,phat-1)

end


function loadgame()
 
 basiccoins = pmem(0)

 for i=1,#records do
  local grab = pmem(i)
  if grab >=999999 then
   spcoins[i] = true
   grab = grab-999999
  end
  if grab/1000 <1 then 
   records[i] = 0
  else
   records[i]= grab/1000 + 1
  end
 end
 
 for i=0,#hats do
  if pmem(i+128) == 1 then
   hats[i].owned = true
  end
 end
 
 deaths = pmem(254)
 
 phat = pmem(255)+1

end

function cascadereveal(x,y,til,til2)
 
 
 local repl={104,8,14,104,167,107,30,104}
 
 mset(x//8,y//8+(level-1)*34,repl[world])
 
 spawnparticle(x,y,0,0,0,0,50,5,10,false,10,4)
 spawnparticle(x,y,0,-1,0,0,50,5,8,false,5,4)

 if til2 ~= nil then
	 if mget(x//8+1,y//8+(level-1)*34) == til2 then
	  mset(x//8+1,y//8+(level-1)*34,repl[world])
	  cascadereveal(x+8,y,til,til2)  
	 end
	 
	 if mget(x//8-1,y//8+(level-1)*34) == til2 then
	  mset(x//8-1,y//8+(level-1)*34,repl[world])
	  cascadereveal(x-8,y,til,til2)
	 end
	 
	 if mget(x//8,y//8+1+(level-1)*34) == til2 then
	  mset(x//8,y//8+1+(level-1)*34,repl[world])
	  cascadereveal(x,y+8,til,til2)
	 end
	 
	 if mget(x//8,y//8-1+(level-1)*34) == til2 then
	  mset(x//8,y//8-1+(level-1)*34,repl[world])
	  cascadereveal(x,y-8,til,til2)
	 end
 end
 
 if mget(x//8+1,y//8+(level-1)*34) == til then
  mset(x//8+1,y//8+(level-1)*34,repl[world])
  cascadereveal(x+8,y,til)
  
 end
 
 if mget(x//8-1,y//8+(level-1)*34) == til then
  mset(x//8-1,y//8+(level-1)*34,repl[world])
  cascadereveal(x-8,y,til)
 end
 
 if mget(x//8,y//8+1+(level-1)*34) == til then
  mset(x//8,y//8+1+(level-1)*34,repl[world])
  cascadereveal(x,y+8,til)
 end
 
 if mget(x//8,y//8-1+(level-1)*34) == til then
  mset(x//8,y//8-1+(level-1)*34,repl[world])
  cascadereveal(x,y-8,til)
 end
end

function carrylogic(id)
 solids[49]=true
 --side collision with walls
	if solid(ents[id].x+7,ents[id].y) 
	or solid(ents[id].x+7,ents[id].y+5) then
	 if ents[id].ty ~= 212 then	
			ents[id].vx = 0
			ents[id].x = (ents[id].x//8)*8
			ents[id].canpush = false
		else
		 ents[id].vx = -ents[id].vx
			ents[id].x = ents[id].x-2
		end
	elseif solid(ents[id].x+ents[id].vx,ents[id].y)
	or solid(ents[id].x+ents[id].vx,ents[id].y+5) then
  if ents[id].ty ~= 212 then
	  ents[id].vx = 0
	  ents[id].x = ((ents[id].x+4)//8)*8
	  ents[id].canpush = false
		else
		 ents[id].vx = -ents[id].vx
			ents[id].x = ents[id].x+2
		end
	else
	 if solid(ents[id].x+4,ents[id].y+12) then
		 ents[id].vx = ents[id].vx*0.94
		 ents[id].canpush = nil
		else
		 ents[id].vx = ents[id].vx*0.98
		end
	end
 
 --fix if trapped in wall
 if solid(ents[id].x+4,ents[id].y+4) then
  if solid(ents[id].x-4,ents[id].y+4) then
   ents[id].x = ents[id].x+8
  elseif solid(ents[id].x+12,ents[id].y+4) then
   ents[id].x = ents[id].x-8
  end 
 end
 
 solids[49]=false
 
 --only one tile carryables
	if (p.x+p.vx) < ents[id].x+8
	and (p.x+p.vx) > ents[id].x-7 
	and p.y+p.vy > ents[id].y -8
 and p.y+p.vy < ents[id].y+10 then
	 
		if p.vy>0.2 
		and ents[id].carried == nil 
	 and ents[id].ty ~= 231	then
		 
			--high bounce
			if ents[id].ty ~= 212 then
				if btn(4) then
				 p.vy = -4
				else
			  p.vy = -2
				end
			ents[id].vx = p.vx-2*(p.fl-0.5)
			
			--shell
			elseif ents[id].ty == 212 
			and ents[id].bct == 0 then
			 if btn(4) then
				 p.vy = -4
				else
			  p.vy = -2
				end
			--	ents[id].vx = ents[id].vx/4
			end
			
		--use box as platform
		elseif ents[id].carried == nil 
	 and ents[id].ty == 231 
		and p.y<ents[id].y-2 then
			platlogic(id,-7,8)
   
		else
			local btning = false
			
			if btn(5) or btn(6) then
				if ents[id].ty == 212 
			 and p.vy>0.2 
				and ents[id].carried == nil then
			  if btn(4) then
				  p.vy = -4
				 else
			   p.vy = -2
				 end
			 else
			  btning = true
				end
			end
			
		 if p.carry == nil 
			and btning == true then
			 ents[id].carried = true
    p.carry = true
			else
			 --kick
				if ents[id].canpush == nil 
				and ents[id].entside == nil 
				and ents[id].ridden == nil 
				and not solid(ents[id].x+ents[id].vx+7,ents[id].y) 
	   and not solid(ents[id].x+ents[id].vx+7,ents[id].y+6) 
				and not solid(ents[id].x-1+ents[id].vx,ents[id].y)
	   and not solid(ents[id].x-1+ents[id].vx,ents[id].y+6) then
     --if ents[id].ty ~= 212 then
			   ents[id].vx = p.vx-3*(p.fl-0.5)
					--end
				else
				 if p.x>ents[id].x 
					and ents[id].carried == nil then
				  p.vx=0.2
					elseif p.x<ents[id].x 
					and ents[id].carried == nil then
					 p.vx=-0.2
					end
				end

				if ents[id].ty ~= 231 then
					if not solid(ents[id].x,ents[id].y-1)
					and not solid(ents[id].x+7,ents[id].y-1) then
					 ents[id].vy = -1
					else
					 ents[id].vy=0
						ents[id].y = ents[id].y+1
					end
				end
			end
		end
	end
 
 if ents[id].carried ~= nil 
 and ents[id].ridden == nil then
  ents[id].entside = nil
	 if btn(5) or btn(6) then 
			 ents[id].x = p.x
				ents[id].y = p.y-8
				ents[id].bct = 16
		else
		 if not solid(ents[id].x,ents[id].y-4)
			and not solid(ents[id].x+7,ents[id].y-4) then
		  --uptoss
				if btn(0) then
				 ents[id].y = ents[id].y-2+p.vy/2
				 ents[id].vy = p.vy-4
					ents[id].vx = 0
				--set gently
				elseif btn(1) then
				
				 ents[id].vy = 0
					ents[id].vx = 0
					
					ents[id].x = ents[id].x-15*(p.fl-0.5)
				else
				--throw forward
				 ents[id].vy = 0.5
					
					if ents[id].ty ~= 212 then
					 ents[id].vx = p.vx-9*(p.fl-0.5)
					
					else
					 ents[id].vx = p.vx-3*(p.fl-0.5)
						
						if ents[id].vx < 3
						and ents[id].vx >0 then
						 ents[id].vx = 3
							
						elseif ents[id].vx >-3
						and ents[id].vx <=0 then
						 ents[id].vx = -3
						
						end
					end
    end
			else
			 ents[id].vy = 0
				ents[id].y = ((ents[id].y+4)//8)*8+8
				if not solid(p.x+4,p.y+10) then
				 p.y = p.y+6
				end
			end
			
		 ents[id].carried = nil
		 p.carry = nil
			if ents[id].ct <1 then
			 ents[id].ct = 400
			end
		end
		
		
	elseif ents[id].carried == true then
	 ents[id].ridden = nil
	elseif ents[id].ridden == true then
	 ents[id].carried = nil
	end  
	
	
 if ents[id].bct ~= nil then
	 if ents[id].bct >0 then
	  ents[id].bct = ents[id].bct -1
	 end
	end
	
	local throwcap = 4
	
	if ents[id].vx>throwcap then
	 ents[id].vx = throwcap
	elseif ents[id].vx<-throwcap then
	 ents[id].vx=-throwcap
	end
end

--platforms
function platlogic(id,left,right)
   
 if not left then
  left =-7
 end
 if not right then
  right = 16
 end
 
 if (p.x+p.vx) < ents[id].x+right
	and (p.x+p.vx) > ents[id].x+left
	and p.y+8+p.vy > ents[id].y 
 and p.y+p.vy < ents[id].y
 and p.vy>0  then
		
		landing()

  if ents[id].y>30 
		and ents[id].ty == 213 then
		 ents[id].y = ents[id].y-0.5
		end
		
		
		p.x = p.x+ents[id].vx

		p.y = ents[id].y-7+ents[id].vy
	else 

		if ents[id].ty == 213 then
		 if ents[id].y<ents[id].oy then
		  ents[id].y=ents[id].y+0.5
			end
		end
 end					
end

function entplat(id,left,right)
 local ridenum = 0
 for k,ent in pairs(ents) do
  if canland[ents[k].ty]==true 
  and (ents[k].x+ents[k].vx) < ents[id].x+right
		and (ents[k].x+ents[k].vx) > ents[id].x+left
		and ents[k].y+8+ents[k].vy > ents[id].y 
  and ents[k].y+3+ents[k].vy < ents[id].y 
  and ents[k].vy >0 then	
				ridenum = ridenum+1
				ents[k].vy=0
				
				ents[k].x = ents[k].x+ents[id].vx

				ents[k].y = ents[id].y-7+ents[id].vy

  end
 end
 
 if ridenum>0 then
  ents[id].ridden = true
 else
  ents[id].ridden = nil 
 end
 
end

function entsidecol(id,left,right)
 
 local colnum = 0
 for k,ent in pairs(ents) do
	 if ents[k].x>ents[id].x+left-3
		and ents[k].x<ents[id].x+left
  and ents[k].y>ents[id].y-6 
  and ents[k].y<ents[id].y+8 then
		 colnum = colnum+1
			ents[k].vx = 0
			ents[k].entside = true
			ents[id].entside = true
		elseif ents[k].x>ents[id].x+right
		and ents[k].x<ents[id].x+2+right 
  and ents[k].y>ents[id].y-6 
  and ents[k].y<ents[id].y+8 then
   colnum = colnum+1
		 ents[k].vx = 0
			ents[k].entside = true
			ents[id].entside = true
		end
 end
 
 if colnum ==0 then
  ents[id].entside = nil
 end
 
end


function sidecol(id,left,right)
	if p.x>ents[id].x+left-3
	and p.x<ents[id].x+left
	and p.y>ents[id].y-6 
	and p.y<ents[id].y+7 then
		p.vx = -0.2
	elseif p.x>ents[id].x+right
	and p.x<ents[id].x+2+right 
	and p.y>ents[id].y-6 
	and p.y<ents[id].y+7 then
	 p.vx = 0.2
	end
end

function entbonk(id,left,right)
	if p.x>ents[id].x+left-3 
	and p.x<ents[id].x+2+right 
 and p.y>ents[id].y+6 
 and p.y<ents[id].y+10 
	and p.vy<0 then
	 p.vy=0
		if ents[id].ty == 246 then
		 ents[id].hit = true
			ents[id].hitct = 6
		end
		return
	end
	
	if p.x+p.vx>ents[id].x+left-3 
	and p.x+p.vx<ents[id].x+2+right 
 and p.y+p.vy>ents[id].y+3 
 and p.y+p.vy<ents[id].y+10 
	and p.vy<0 then
	 p.vy=0
		if ents[id].ty == 246 then
		 ents[id].hit = true
			ents[id].hitct = 6
		end
		return
	end
	
end
